import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Open the modal by clicking the first product card
    const productCard = page.locator('.product-card').first();
    await productCard.click();

    // 2. Wait for the modal to be visible and take a screenshot
    const modal = page.locator('#productModal');
    await modal.waitFor({ state: 'visible' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    const modalDisplayStyleBefore = await modal.evaluate(el => getComputedStyle(el).display);

    // 3. Press the Escape key to close the modal
    await page.keyboard.press('Escape');

    // 4. Wait for the modal to be hidden and take a screenshot
    await modal.waitFor({ state: 'hidden' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    const modalDisplayStyleAfter = await modal.evaluate(el => getComputedStyle(el).display);

    return {
      success: true,
      action: "Successfully opened a modal, pressed the Escape key, and verified the modal closed.",
      extractedData: {
        modalDisplayStyleBefore: modalDisplayStyleBefore, // Should be 'block'
        modalDisplayStyleAfter: modalDisplayStyleAfter   // Should be 'none'
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to close modal with Escape key",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
